import Head from "next/head";

export default function Allposts({ postsList }) {
  return (
    <div className="allposts-container">
      <Head>
        <title>Create Next App</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <main>
        <ul>
          {postsList.map((post) => {
            return <li>{post.title}</li>;
          })}
        </ul>
      </main>
    </div>
  );
}
